import React from 'react';
import BarChartV from './src/BarChart';
import LineChartV from './src/LineChart';
import PieChartV from './src/PieChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div style={{background:'#eee'}} >
     <PieChartV/>
     <br/>
     <div style={{width:'800px',background:'white'}}> <BarChartV/></div>

     <div style={{width:'800px',background:'white'}}>
     <LineChartV />
     </div>
     <RadarChartV/>
    </div>
  );
}

export default App;
